column3:
Hai riposto {tag:0}{tag:1} nella
tasca {tag:2}{pageend:.}
La terra è di nuovo soffice e fertile.

Metti le bacche nella pentola e mescola
{pageend:nella direzione indicata dalla freccia.}
Fai attenzione, però! Se mescoli troppo
{pageend:lentamente, brucerai l’impasto.}
Se invece ci metti troppa foga, rischierai
{pageend:di farlo traboccare.}
Quindi cerca di fare le cose con cura e il tuo
{pageend:poffin verrà una meraviglia!}
Infine, ricorda che puoi preparare i poffin
anche nel Parco Concordia.

Metti le bacche nella pentola e mescola
{pageend:nella direzione indicata dalla freccia.}
Fai attenzione, però! Se mescoli troppo
{pageend:lentamente, brucerai l’impasto.}
Se invece ci metti troppa foga, rischierai
{pageend:di farlo traboccare.}
Quindi cerca di fare le cose con cura e il tuo
poffin verrà una meraviglia!
